import React, {Component} from 'react';
import {NavLink} from "react-router-dom"; 

import '../styles/Nav.css';
import logo from '../images/logodark.png';

class Nav extends Component {
    constructor(props) {
        super(props);
        this.state = {
            showLogo: false
        }
    }

    render() {
        return (
            <div className="nav-container" style={this.showLogo? {justifyContent: 'space-between'} : {justifyContent: 'flex-end'}}>
                {this.state.showLogo? 
                <img src={logo}></img> : null}
                <ul>
                    <li>
                        <NavLink className="nav-link" to="/about">About</NavLink>
                    </li>
                    <li>
                        <NavLink className="nav-link" to="/foundations">Workshops</NavLink>
                    </li>
                    <li>
                        <button className="btn">Register</button>
                    </li>
                </ul>

            </div>    
        )
    }

}

export default Nav;
